import React from "react";
import { Row, Col, Button, Carousel } from "antd";
import list from "../assets/questions";

import Question from "../components/Question";

const questionList = list.map((obj) => (
	<Question q={object.q} a1={object.a1} a2={object.a2} key={i} />
));

const Dog = () => {
	return (
		<>
			<Row>
				<h1>hello dog!</h1>
			</Row>

			<Row>
				<Carousel dotPosition="left">
					{list.map((object, i) => (
						<Question
							q={object.q}
							a1={object.a1}
							a2={object.a2}
							key={i}
						/>
					))}
				</Carousel>
			</Row>
		</>
	);
};

export default Dog;
